import { Header } from '../header';
import { Footer } from '../footer';

import {
  StyledLayout,
  LinesWrapper,
  Lines,
  MainLayout,
} from './layout.styles'


export const Layout = ({children}) => {
  return (
    <>
      <Global styles={globalStyles} />
      <StyledLayout>
        <LinesWrapper>
          <Lines />
          <Lines />
          <Lines />
          <Lines />
          <Lines />
        </LinesWrapper>
        <Header />
        <MainLayout>
          {children}
        </MainLayout>
        <Footer />
      </StyledLayout>
    </>
  )
}
